import React from 'react';

const FileList = ({ files }) => {



    return (
        <div>
            <p style={{ marginTop: '10px', padding: 0 }}>Name</p>
            <ul style={{ listStyleType: 'none', padding: 0 }}>
                {files.map((file, index) => (
                    <li key={index}>{file}</li>
                ))}
            </ul>
        </div>
    );
};

export default FileList;
